import * as jsPDF from "jspdf";

(function (jsPDFAPI) {
  var font =
    "";
  var callAddFont = function () {
    this.addFileToVFS("UnderlineMonospace-normal.ttf", font);
    this.addFont(
      "UnderlineMonospace-normal.ttf",
      "UnderlineMonospace",
      "normal"
    );
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
